import React, { Component } from "react";
import "../App.css";

export class testcomp extends Component {
  render() {
    return (
      <div class="whapper">
        <header class="header">
          <div class="container">
            <nav class="navbar">
              <a href="#" class="logo">
                ADIL
              </a>
              <ul class="menu">
                <li class="menu-item">
                  {" "}
                  <a href="#">Товары</a>
                </li>
                <li class="menu-item">
                  {" "}
                  <a href="#">Цены</a>
                </li>
                <li class="menu-item">
                  {" "}
                  <a href="#">Регистрация</a>
                </li>``
                <li class="search">
                  {" "}
                  <a href="#">Поиск</a>
                </li>
              </ul>
            </nav>
          </div>
        </header>
      </div>
    );
  }
}

export default testcomp;
